import Navbar from "./Navbar";

function Header() {
    return (
        <header>
            <div>
                <img src='https://peverdemarketing.com/wp-content/uploads/2022/02/Peverdemarketing.png' alt='Logo pverdecommerce' />
            </div>

            <div>
                <Navbar/>
            </div>
        </header>
    )
}

export default Header
